def processed_frame_and_windows():
    red_frame_filt = bandpass(BPM_FRAME['red_frame'], low=CONFIG['freq_band'][0], high=CONFIG['freq_band'][1], fs=CONFIG['bpm_fs']).tolist()
    ir_frame_filt = bandpass(BPM_FRAME['ir_frame'], low=CONFIG['freq_band'][0], high=CONFIG['freq_band'][1], fs=CONFIG['bpm_fs']).tolist()
    frame_filt = [red_frame_filt, ir_frame_filt]

    pulse_rate, spo2, r = predict_cardiac_values(frame_filt, fs=CONFIG['bpm_fs'])

    flipped_combined = flip_and_combine(frame_filt)
    frame_resamp = resample_frame(sig=flipped_combined, fs_old=CONFIG['bpm_fs'], fs_new=CONFIG['fs'])
    samples = split_frame(sig=frame_resamp, n=int(len(frame_resamp) / CONFIG['win_len']))

    processed_frame = BPM_FRAME
    processed_frame.update(dict(
        status='processed',
        pulse_rate=pulse_rate,
        spo2=spo2,
        r=r,
    ))
    windows = [doc for doc in generate_window_document(samples, BPM_FRAME['fid'])]
    return processed_frame, windows

def processed_valid_window():
    result = validate_window(RAW_VALID_WINDOW['ppg_raw'], CONFIG)
    processed_valid_window = {
        'sid': '123456789',
        'fid': '123456789',
        'status': 'valid',
        'ppg_raw': RAW_VALID_WINDOW['ppg_raw'],
        'ppg': result['ppg'],
        'vpg': result['vpg'],
        'apg': result['apg'],
        'ppg_scaled': result['ppg_scaled'],
        'vpg_scaled': result['vpg_scaled'],
        'apg_scaled': result['apg_scaled'],
        'f0': result['f0'],
        'snr': result['snr'],
        'beat_sim': result['beat_sim'],
        'abp_scaled': [0],
        'abp': [0],
    }
    return processed_valid_window

def predicted_window():
    processed_window = processed_valid_window()
    data = format_as_json(processed_window)[0]
    result = predict_bp(data, CONFIG)
    predicted_window = processed_window
    predicted_window.update({
        'status': 'predicted',
        'abp_scaled': result['abp_scaled'],
        'abp': result['abp'],
    })
    return predicted_window
